import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faGithubSquare } from '@fortawesome/free-brands-svg-icons';

export default function Github() {
  return (
    <a
      target="_blank"
      rel="noreferrer"
      href="https://github.com/danieldenton"
      className="github"
    >
      <FontAwesomeIcon
        icon={faGithubSquare}
        style={{ color: 'white' }}
      />
    </a>
  );
}
